import React, { useState } from "react";

const VideoUpload = () => {
  //index & state of clicked
  const [index, setIndex] = useState(null);
  const [isClicked, setClick] = useState(false);
  //information of the clicked photo
  const [change, setChange] = useState([{ title: "", link: "" }]);
  //array of images
  const [image, setImage] = useState([
    {
      title: "Night Sky",
      link:
        "https://astronomy.com/-/media/Images/News%20and%20Observing/Sky%20this%20Week/STW%202018/05/stars1245902_1920.jpg?mw=600"
    },
    {
      title: "Warm Beach",
      link:
        "data:image/jpeg;base64,"
    },
    {
      title: "Fresh Stream",
      link:
        "data:image/jpeg;base64,"
    },
    {
      title: "Exotic Forest",
      link:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRqLEq5X4LuiqbrQtxkwYBoSkYTgmW2sKnzoA&usqp=CAU"
    }
  ]);

  //Handlers
  const inputHandler = (e, key) => {
    return setChange({ ...change, [key]: e.target.value });
  };
  console.log(change);
  console.log(image);
  //Functions
  const mapImages = () => {
    return image.map((e, i) => {
      return (
        <div>
          <h4>{e.title}</h4>
          <img
            src={e.link}
            alt="not found"
            onClick={() => {
              return (
                setClick(true),
                setIndex(i),
                setChange({ title: e.title, link: e.link })
              );
            }}
          />
        </div>
      );
    });
  };

  //UPDATE EDIT
  const editImage = () => {
    var newImage = [...image];
    newImage[index] = change;
    return setImage([...newImage]);
  };

  //ADD IMAGE
  const addImage = () => {
    var newImage = [...image];
    newImage.push(change);
    return setImage([...newImage]);
  };

  //EDITING
  const allowEdit = () => {
    return (
      <form
        onSubmit={(e) => {
          e.preventDefault();
          editImage();
        }}
      >
        <label>title</label>
        <input
          value={change.title}
          type="text"
          onChange={(e) => inputHandler(e, "title")}
        />
        <label>image</label>
        <input
          value={change.link}
          type="text"
          onChange={(e) => inputHandler(e, "link")}
        />
        <button type="submit">Edit</button>
        <button type="button" onClick={() => addImage()}>
          Add
        </button>
      </form>
    );
  };
  //MAIN CODE
  return (
    <div>
      {mapImages()}
      {isClicked ? allowEdit() : <div></div>}
    </div>
  );
};

export default VideoUpload;
